   useEffect(()=>{
       getCurrentProfile()
   },[])

    return (
        <div>
           dashboard 
        </div>
    )
}

const mapStateToProps=state=>({
    auth:state.auth,
    profile:state.profile
})

export default connect(mapStateToProps,{getCurrentProfile}) (DashboardProfile)
